import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";

const data = [
  {
    name: "Directions",
    action: 4000,
    inaction: 2400,
    amt: 2400
  },
  {
    name: "Moving",
    action: 3000,
    inaction: 1398,
    amt: 2210
  },
  {
    name: "Alert",
    action: 2000,
    inaction: 9800,
    amt: 2290
  },
  {
    name: "Eat",
    action: 2780,
    inaction: 3908,
    amt: 2000
  }
];

class DOA extends PureComponent {
  render() {
    return (
      <BarChart
        width={500}
        height={300}
        data={data}
        margin={{
          top: 5,
          right: 30,
          left: 20,
          bottom: 5
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="action" fill="#8884d8" background={{ fill: "#eee" }} />
        <Bar dataKey="inaction" fill="#82ca9d" />
      </BarChart>
    );
  }
}

export default DOA;
